import './../Nosotros/Nosotros.css'

const Nosotros = () => {
    return (
        <div className="nosotros-container">
            <h2>¿Qué es Comarca de Creadores?</h2>
            <p>Somos un espacio, ubicado estrategicamente en Barrio General Paz, donde comercializamos elementos para la creación <br></br>
            Creamos un mix entre una artística, mercería y taller de capacitaciones, par que cada persona que ingrese pueda encontrar todo lo que necesita para su proyecto de reciclaje, restauración o creación.<br></br>
            </p>
        </div>
    )
}

export default Nosotros
